import React from "react";
import './Collapse.css'

export default function Collapse(props){
    return (
        <div>
            <div className="title">
                <h2>Fiable</h2>
            </div>
            <div className="text">
                <p>{props.description}</p>
            </div>
        </div>
    )
}
